import './App.css';

function App() {
  return <GrandFather />;
}

function GrandFather() {
  const name = "이범규";
  return <Mother gfName={name} />;
}

function Mother(props) {
  return <Child gfName={props.gfName}/>
}

function Child(props) {
  return <div>{props.gfName}입니다!</div>;
}


export default App;
